import React, { useState } from "react";
import "./Square.css";
import "./Board.css";

function Square(props: any) {
  return <div onClick={props.onClick}>a</div>;
}

export function Board() {
  return (
    <div className="bigboard">
      <div className="row">
        <Square onClick={() => console.log("Hi")} />
        <Square />
        <Square />
        <Square />
        <Square />
        <Square />
        <Square />
        <Square />
      </div>
    </div>
  );
}
